description:
Downloaded - The Napster Revolution

Technology Documentary with no narration published by VH1 in 2013 - English language


Information
------------------------------

&quot;Downloaded&quot; focuses on the advent of digital media sharing, including the rise of game-changing company Napster and controversial pioneers Shawn Fanning and Sean Parker. The digital revolution ultimately created a technology paradigm shift and upended the music industry. Audiences will hear insight from well known music artists and figures within the music industry including: The Beastie Boys' Mike D, Noel Gallagher, Henry Rollins, former Sony Music Chairman, Don Ienner, former record producer and Island Records founder Chris Blackwell and Hilary Rosen, former CEO of the Recording Industry Association of America.

